import React from 'react'
import Navbar from '../Navbar/Navbar'
import './Home.css'
import '../../cssHelper/helper.css'
import Products from '../Products/Products'

function Home() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(resetShowNavbar());
  }, [dispatch]);
  return (
    <div className='Home size-full'>
      <Products/>
    </div>
  )
}

export default Home
